import './App.css';


//app is known as component
function App() {

  return (
    <div className="App">
        <Job salary = {25000} position = "Software Engineer" company = "BBD"/>
        <Job salary = {30000} position = "Data Engineer" company = "GCRA"/>
        <Job salary = {19000} position = "Back-end Engineer" company = "FNB"/>
      </div>
  );
};

const Job = (props) => {
  return (
    <div>
    <h1>{props.salary}</h1>
    <h1>{props.position}</h1>
    <h1>{props.company}</h1>
    </div>
  );
};

export default App;
